webpackJsonp([21,262],{169:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/introduksjon_til_computercraft/introduksjon_til_computercraft.8636fd.png"},907:function(e,t,r){e.exports={frontmatter:r(288),content:r(1510)}},1510:function(e,t,r){e.exports="<section class=intro id=introduksjon> <h1 class=intro id=introduksjon>Introduksjon</h1> <p><a href=http://www.computercraft.info/ >ComputerCraft</a> er en mod til <a href=https://minecraft.net/ >Minecraft</a>, som gir deg muligheten til å bygge og programmere <strong>datamaskiner</strong> og <strong>roboter</strong> inne i Minecraft-verdenen.</p> <figure><img src="+r(169)+' alt=""/></figure> </section> <section class=activity id=installering-av-computercraft> <h1 class=activity id=installering-av-computercraft>Installering av ComputerCraft</h1> <p>ComputerCraft er en mod til Minecraft, og krever derfor at Minecraft allerede er installert på datamaskinen. Vi antar at du er kjent med og har installert Minecraft.</p> <p>ComputerCraft er typisk ikke tilgjengelig for siste versjon av Minecraft. Legg derfor merke til hvilken versjon av Minecraft som kreves (i eksemplene nedenfor kreves versjon 1.8.9, men dette kan endre seg), og pass på at du installerer riktig versjon av Forge.</p> <section class=check id=sjekkliste> <h2 class=check id=sjekkliste>Sjekkliste</h2> <ul> <li> <p>Gå til <a href=http://www.computercraft.info/download/ >computercraft.info/download</a>. Bla nedover på siden til du finner et avsnitt som heter <strong>Download and installing</strong>. Last ned ComputerCraft til datamaskinen din, og noter deg hvilken versjon av Minecraft denne er kompatibel med (for eksempel versjon 1.8.9). <em>Ikke</em> prøv å kjør filen, vi skal kopiere den til riktig sted litt senere.</p> <figure><a href=http://www.computercraft.info/download/ ><img src='+r(2041)+' alt=""/></a></figure> </li> <li> <p>Start <strong>Minecraft Launcher</strong>. Sjekk om du har den riktige versjonen av Minecraft tilgjengelig. Hvis ikke kan du velge <code>New Profile</code> og i nedtrekksmenyen <code>Use Version</code> velger du riktig versjon. Gi profilen et navn (for eksempel versjonsnummeret) og klikk <code>Save Profile</code>. Klikk <code>Play</code> slik at denne versjonen blir lastet ned og startet opp. Avslutt spillet.</p> <figure><img src='+r(2045)+' alt=""/> </figure> </li> <li> <p>Før vi kan legge inn ComputerCraft må vi installere <strong>Minecraft Forge</strong>, som gir oss tilgang til å legge inn Mods. Gå til <a href=http://files.minecraftforge.net/ >files.minecraftforge.net</a> og velg den riktige Minecraft-versjonen i menyen som heter <strong>Minecraft Versions</strong> midt på skjermen. Pass på at riktig versjonsnummer vises under tittelen på toppen av skjermen.</p> <figure><a href=http://files.minecraftforge.net/ ><img src='+r(2042)+' alt=""/></a></figure> <p>I boksen <strong>Download Recommended</strong> velger du <code>Installer</code>. Du kommer nå til en reklameside. <strong>Vent</strong> til nedtellingen øverst til høyre er ferdig. Klikk <strong>deretter</strong> på <code>Skip</code> og nedlastingen av en fil starter.</p> <figure><a href=http://files.minecraftforge.net/ ><img src='+r(2043)+' alt=""/></a></figure> </li> <li> <p>Kjør filen som ble lastet ned ved å dobbelklikke på den (om du blir spurt hvordan den skal kjøres kan du velge Java eller JDK). Velg <code>Install client</code> og klikk <code>OK</code>.</p> <figure><img src='+r(2040)+' alt=""/> </figure> </li> <li> <p>Start <strong>Minecraft Launcher</strong>. Det har nå dukket opp en ny profil som heter <code>Forge</code>. Velg denne og start spillet. Dette vil lage en <code>mods</code>-katalog i <code>Minecraft</code>-katalogen din. Du vil også se at det har dukket opp et nytt valg i hovedmenyen: <code>Mods</code>. Avslutt spillet igjen.</p> <figure><img src='+r(2046)+' alt=""/> </figure> </li> <li> <p>Finn <code>Minecraft</code>-katalogen din ved å starte <strong>Minecraft Launcher</strong>. Velg deretter <code>Edit Profile</code> og klikk knappen <code>Open Game Dir</code>. Dette åpner en filutforsker. Velg katalogen <code>mods</code>, og kopier <strong>ComputerCraft</strong>-filen vi lastet ned helt først inn i <code>mods</code>-katalogen. Klikk <code>Cancel</code> i <code>Edit Profile</code>-vinduet.</p> <figure><img src='+r(2044)+' alt=""/> </figure> </li> <li> <p>Nå er vi ferdige. I <strong>Minecraft Launcher</strong> kan du nå velge profilen <code>Forge</code> og klikke <code>Play</code>. Når du klikker <code>Mods</code> fra hovedmenyen skal du se at <strong>ComputerCraft</strong> er en av de tilgjengelige mods\'ene.</p> </li> </ul> </section> <section class=tip id=minecraftkatalogen> <h2 class=tip id=minecraftkatalogen>Minecraftkatalogen</h2> <p>Minecraftkatalogen er nyttig å kjenne til. Som nevnt over kan du finne den ved å klikke <code>Open Game Dir</code> fra <code>Edit Profile</code>-vinduet. Alternativt kan du hente den frem selv som følger:</p> <p><strong>Windows</strong>: Under Windows finner du <code>Minecraft</code>-katalogen under <code>%appdata%\\.minecraft</code>. Søk etter <code>%appdata%</code> i en utforsker eller i kjør-feltet etter å ha klikket start-knappen.</p> <p><strong>Mac OS X</strong>: Under Mac ligger <code>Minecraft</code>-katalogen i <code>Library/Application Support/minecraft/</code> under hjemmekatalogen din. På norsk heter <code>Library</code> <code>Bibliotek</code>.</p> <p><strong>Linux</strong>: På Linux finner du <code>Minecraft</code>-katalogen som en skjult katalog <code>.minecraft</code> rett under hjemmekatalogen din.</p> </section> </section> <section class=activity id=kom-i-gang> <h1 class=activity id=kom-i-gang>Kom i gang</h1> <p>Vi er nå klare til å slå oss opp som programmerere i Minecraft-verdenen. Mens vi utforsker datamaskinene er det enklest med et rolig og enkelt spill:</p> <section class=check id=sjekkliste-2> <h2 class=check id=sjekkliste-2>Sjekkliste</h2> <ul> <li> <p>Velg <code>Singleplayer</code>, og klikk <code>Create New World</code>.</p> </li> <li> <p>Gi verdenen din et navn, og sett <code>Game Mode</code> til <code>Creative</code>. Klikk <code>Create New World</code>.</p> </li> <li> <p>Du kan nå lage din første datamaskin. Trykk <code>E</code> for å gå til Inventory-listen. Øverst kan du nå velge å klikke <code>&gt;</code> for å gå til neste side. Trykk deretter på datamaskin-symbolet (en grå kloss/skjerm), og gi deg selv en <strong>Advanced Computer</strong>.</p> </li> <li> <p>Sett ut en <strong>Advanced Computer</strong> ved å høyre-klikke. Høyre-klikk så en gang til på datamaskinen du nettopp satte ut. En svart skjerm skal dukke opp, med teksten <code>CraftOS</code> og et versjonsnummer i øverste linje. Skriv <code>help</code> og trykk <strong>enter</strong> for å komme igang.</p> </li> </ul> <p>Gratulerer! Du har startet en datamaskin inne i Minecraft-verdenen. På <a href=http://kodeklubben.github.io/computercraft/ >kodeklubben.github.io</a> finner du oppgaver som viser deg hvordan du kan programmere den og andre datamaskiner og roboter i ComputerCraft. Lykke til!</p> </section> </section>'},2040:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/installasjon/installer_forge.947fa0.png"},2041:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/installasjon/last_ned_computercraft.d45bd0.png"},2042:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/installasjon/minecraft_forge_a.c4f90b.png"},2043:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/installasjon/minecraft_forge_b.7e2ad2.png"},2044:function(e,t){e.exports="data:image/png;base64,"},2045:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/installasjon/minecraft_versjon.b766d0.png"},2046:function(e,t,r){e.exports=r.p+"_/tjesi_oppgaver/src/computercraft/installasjon/start_forge.4e24ec.png"}});